import styles from "./Home.module.scss";
const Home = () => {
  return (
    <div className={styles["home-container"]}>
      <div className="d-flex justify-content-between">
        <div>STEPHEN</div>
        <div>
          <u>ABOUT</u>
        </div>
      </div>
    </div>
  );
};

export default Home;
